            "urls" : [ ],
            "text" : "Hi Tim,\nHope you're doing well in these crazy times! I see you're making maps of your estate :-)\nI've just finished recording a podcast episode with @MapScaping and was wondering - since you also did a podcast for a while - whether you'd be interested to join the MapScaping podcast to talk about open source communities or projects like InaSafe (I'd really love to hear the story behind that project)",
