            "urls" : [
              {
                "url" : "https://t.co/2rzPyjE4KA",
                "expanded" : "https://opengeospatialdata.springeropen.com/osgs",
                "display" : "opengeospatialdata.springeropen.com/osgs"
              }
            ],
            "text" : "We got it accepted for Call for Papers https://t.co/2rzPyjE4KA",
            "mediaUrls" : [ ],
            "senderId" : "38512725",
            "id" : "1037590839013376004",
